import React from "react";

function SkillsSection() {
  const skills = [
    { name: "Figma", desc: "UI Design, Prototyping" },
    { name: "JavaScript", desc: "Front-End Development" },
    { name: "React", desc: "Web Apps & SPA" },
    { name: "HTML & CSS", desc: "Responsive Design" },
  ];

  return (
    <section className="py-20 bg-gray-50 text-center">
      <h2 className="text-3xl font-bold text-gray-800 mb-3">Keahlian</h2>
      <p className="text-gray-600 mb-10">
        Saya menguasai berbagai tools dan teknologi untuk membangun produk digital yang modern.
      </p>
      <div className="flex flex-wrap justify-center gap-8">
        {skills.map((skill) => (
          <div
            key={skill.name}
            className="bg-white w-64 p-8 rounded-xl shadow hover:shadow-lg transition"
          >
            <h3 className="font-semibold text-lg text-gray-800 mb-2">{skill.name}</h3>
            <p className="text-gray-500 text-sm">{skill.desc}</p>
          </div>
        ))}
      </div>
    </section>
  );
}

export default SkillsSection;
